import NavBar from "./components/NavBar";
import Hero from "./components/Hero";
import Card from "./components/Card";


export default function App(){
    return (
        <div className="container">
            <NavBar />
            <Hero />
            <Card 
                img="zaderea.png"
                rating="5.0"
                reviewCount={6}
                country="USA"
                title="Life Lessons with Katie Zaferes"
                price={136}
            />

            <Card 
                img="zaderea.png"
                rating="1.0"
                reviewCount={6}
                country="RO"
                title="Cand pierzi nu castigi"
                price={136}
            />

            <Card 
                img="poza_stagii.jpg"
                rating="10.0"
                reviewCount={200}
                country="RO"
                title="Web Dev Master"
                price={200}
            />

        </div>
    )
}
